// src/components/UserListWithNeonCursor.js
import React from 'react';
import UserList from './UserList';

const UserListWithNeonCursor = ({ users, editUser, deleteUser }) => {
  return (
    <div className="user-list-container">
      <UserList
        users={users}
        editUser={editUser}
        deleteUser={deleteUser}
      />
    </div>
  );
};

export default UserListWithNeonCursor;
